	#endif

	cudaFree(bd);
	cudaFree(d1d);
	cudaFree(d2d);
	cudaFree(d3d);
	cudaFree(v1d);
	cudaFree(v2d);
	cudaFree(v3d);
	cudaFree(h1d);
	cudaFree(h2d);
